import React, { useState,useContext } from 'react';
import  Logger  from '../Logger';
import { UserContext } from '../UserContext';
import './Login.css';
import Axios from 'axios';
function Login() {
  const {user, setUser} = useContext(UserContext);
  const [name, setName] = useState();
  const [password, setPassword] = useState();
  return (
    <div className='card'>
        <h1> Login </h1>
        
        <div className='textbox'>
            <input type='text' placehorder="Username" onChange={event => setName(event.target.value)}></input>
        </div>
        <div className='textbox'>
            <input type='password' placehorder="Password" onChange={event => setPassword(event.target.value)}></input>
        </div>     
        <button className='gombi'
          onClick={async () =>{
            props = {name:name,password:password}
            const user = await Logger(props);
            if( user.username != "hibasss"){
              setUser(user)
            }
            else{
              alert('wrong username or password')
            }
          }}>Login</button>
        
            
    </div>
  );
}

export default Login;
